import React from "react";

const Footer = () => {
  return (
    <div className="bg-gray-800 py-10 flex justify-center">
      <div className="logobox flex items-center bg-white p-4  rounded-md ">
        <img src="/images/logo.png" className="w-20 inline-block"></img>
        <h2 className="inline text-3xl  font-semibold pr-4">Homeoz</h2>
      </div>
    </div>
  );
};

export default Footer;
